import axios from "axios";
import { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import styles from "../diet.module.css";
export default function Diet()
{
    const [time,setTime] = new Date();

    const userId=localStorage.getItem('userId');
    const [breakfasts,setBreakfasts] = useState([]);
    const [lunchs,setLunchs] = useState([]);
    const [dinners,setDinners] = useState([]);
    const [totalK,setTotalK] = useState(null);

    useEffect(()=>{
        const timeId = setInterval(()=>{
            setTime(new Date());
        },1000);
        console.log(time.toISOString().split('T')[0]);
        return (()=> clearInterval(timeId));
    },[]);

    useEffect(()=>{
        axios.post('http://localhost:4000/api/breakfast_list',{
            meal_time:'breakfast',
            date:time.toISOString().split('T')[0]
        }).then((food_list)=>{
            setBreakfasts(food_list.data);
        })
    },[]);

    useEffect(()=>{
        axios.post('http://localhost:4000/api/breakfast_list',{
            meal_time:'lunch',
            date:time.toISOString().split('T')[0]
        }).then((food_list)=>{
            setLunchs(food_list.data);
        })
    },[]);

    useEffect(()=>{
        axios.post('http://localhost:4000/api/breakfast_list',{
            meal_time:'dinner',
            date:time.toISOString().split('T')[0]
        }).then((food_list)=>{
            setDinners(food_list.data);
        })
    },[]);

    useEffect(()=>{
        totalKcl();
    },[breakfasts,lunchs,dinners]);
    function totalKcl(){
        let totalkcl = 0;
        breakfasts.forEach((food)=>{
            totalkcl +=food.kcl;
        });
        lunchs.forEach((food)=>{
            totalkcl +=food.kcl;
        });
        dinners.forEach((food)=>{
            totalkcl +=food.kcl;
        });
        setTotalK(totalkcl);
    }
    function deleteFood(food_name,meal_times)
    {
        axios.post('http://localhost:4000/api/diet_delete',{
            user_id:userId,
            meal_time:meal_times,
            food:food_name,
            date:time.toISOString().split('T')[0]
        }).then(()=>{
            if(meal_times==="breakfast")
                setBreakfasts((prevList)=>{
                    prevList.filter((food)=> food.food !==food_name);
                })
        })
    }

    return (
        <div>
            <p>총 섭취 칼로리:{totalK}kcal</p>
            <p><Link className ={styles.meal_time}to={"/id/"+userId+"/diet/breakfast"}>아침</Link></p>
            <ul>
                {breakfasts.map((food)=>{
                    return(
                    <li key={food.food}>
                    식품명:{food.food},식품종류:{food.food_type},칼로리:{food.kcl}kcal,단백질:{food.protein}g,{""},
                    지방:{food.fat}g,탄수화물:{food.carbo}g,제공량:{food.serving_size}g<button onClick={()=>deleteFood(food.food,food.meal_time)}>삭제</button>
                    </li>
                )})

                }
            </ul>
            <p><Link className={styles.meal_time} to={"/id/"+userId+"/diet/lunch"}>점심</Link></p>
            <ul>
                {lunchs.map((food)=>{

                    return(
                    <li key={food.food}>
                    식품명:{food.food},식품종류:{food.food_type},칼로리:{food.kcl}kcal,단백질:{food.protein}g,{""},
                    지방:{food.fat}g,탄수화물:{food.carbo}g,제공량:{food.serving_size}g
                    </li>
                )})
                }
            </ul>   
            <p><Link className={styles.meal_time} to={"/id/"+userId+"/diet/dinner"}>저녁</Link></p>
            <ul>
                {dinners.map((food)=>{

                    return(
                    <li key={food.food}>
                    식품명:{food.food},식품종류:{food.food_type},칼로리:{food.kcl}kcal,단백질:{food.protein}g,{""},
                    지방:{food.fat}g,탄수화물:{food.carbo}g,제공량:{food.serving_size}g
                    </li>
                )})
                }
            </ul>   
        </div>
    );
}
